import React, { Component, useState } from 'react';
import Modal from "react-bootstrap/Modal";
import sessionCheck from "./assets/bg-session-check.png";
import sessionCheckButton from "./assets/button-session-check.svg";


export default function PopupModal(props) {
const {id, handleNoClick, handleYesClick,setShowModal} = props;


    return (
        <div>
  
      <Modal
      style={{ overlay: { background: 'black' } }}
        {...props}
        dialogClassName="popup-dialog"
      contentClassName="popup-content"
      backdrop="static"
      >

        <Modal.Body >
          <button className="popupYes" onClick={() => handleYesClick()}>
                <img src={sessionCheckButton} id="sessioncheck-btn" alt="sessionCheckButton" />
          </button>
   </Modal.Body>
      </Modal>
      
      </div>
    );
  }
